/*
 * crée la liste du personnel actif
 */

import React, { useState, useEffect } from 'react';

function InactiveUsers() {
    const [inactiveUsers, setInactiveUsers] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetch('/wp-json/booker67/v1/human_ressources_actif', {  // Ajustez l'URL en fonction de votre API
            headers: {
                'Content-Type': 'application/json',
            },
        })
            .then(response => response.json())
            .then(data => {
                setInactiveUsers(data);
                setLoading(false);
            })
            .catch(error => console.error('Error fetching inactive users:', error));
    }, []);

    if (loading) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <h2>Personnel actif</h2>
            <ul>
                {inactiveUsers.map(user => (
                    <li key={user.id}>{user.nom} {user.prenom} - {user.role}</li>
                ))}
            </ul>
        </div>
    );
}

export default InactiveUsers;
